+----------------+
|Game Description|
+----------------+

Want a game you can really sink your teeth into? Swim and swerve through underwater worlds, chow down on smaller fish, and chomp your way to ocean supremacy! But watch out: boatloads of pesky predators are looking to make lunch out of you. 

When you're hungry for a different challenge, take a bite out of Time Attack mode. Ride the tide through stunning coral reefs, enchanting sunken ships and other gorgeous marine environments, all while enjoying a steady diet of fabulously frantic fun!

Originally released February 6th, 2009.

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

This game is compatible with Windows 2000, XP, Vista(32/64bit) and 7(32/64bit). Requires DirectX 7.0 or later. Processor requirements: 350MHz CPU or higher. RAM requirements: 128 MB or higher. Requires a DirectX-compatible Sound and Video card with at least 16 MB of video memory.

